import React from 'react';
import tenperformanceImg from './assets/images/tenperformance.png';
import jessakaeImg from './assets/images/jessike.png';
// import avaestellImg from './assets/images/avaestell.png';
// import jmdistroImg from './assets/images/jmdistro.png';

const Portfolio = () => {
  const projects = [
    {
      title: 'Tenperformance',
      description: 'This is a description of project .',
      link: 'https://www.tenperformance.com',
      projectImage: tenperformanceImg,
    },
    {
      title: 'Jessakae',
      description: 'This is a description of project.',
      link: 'https://jessakae.com',
      projectImage: jessakaeImg
    },
    {
      title: 'Avaestell',
      description: 'This is a description of project.',
      link: 'https://avaestell.com',
      projectImage: tenperformanceImg
    },
    {
      title: 'Jm distro',
      description: 'This is a description of project.',
      link: 'https://jm-distro.com/',
      projectImage:tenperformanceImg
    },
  ];
  return (
    <div className="portfolio">
      <header>
        <h1>My Portfolio</h1>
        <p>Welcome to my portfolio! I am a web developer specializing in Shopify Plus.</p>
      </header>
      <section className="projects">
        <h2>Projects</h2>
        <div className="project-list">
          {projects.map((project, index) => (
            <div key={index} className="project">
              {project.projectImage && (
                <img
                  src={project.projectImage}
                  alt={`${project.title} Screenshot`}
                  className="project-image"
                />
              )}
              <h3>{project.title}</h3>
              <p>{project.description}</p>
              <a href={project.link} target="_blank" rel="noopener noreferrer">
                View Project
              </a>
            </div>
          ))}
        </div>
      </section>
      <footer>
        <h2>Contact Me</h2>
        <p>Email: sandeepptpss@gmail.com</p>
      </footer>
    </div>
  );
};

export default Portfolio;
